// react
import React from 'react';

// third-party
import { Link } from 'react-router-dom';

// application
import LogoPanel from './LogoPanel';
import NavPanel from './NavPanel';

function Header() {
    let bannerPanel;

    bannerPanel = (
        <div className="ekat-header__banner-panel">
            banner
        </div>
    );

    return (
        <div className="ekat-header">
            <div className="ekat-header__logo-panel">
                <LogoPanel />
            </div>

            {bannerPanel}
            
            <div className="ekat-header__nav-panel">
                <NavPanel />
                <Link to="/search">
                    settings
                        </Link>
            </div>
        </div>
    );
}

export default Header;
